// File: src/components/CourseList.js
import React, { useState } from 'react';
import './CourseList.css';

function CourseList() {
  // Example course data for enrolled and available courses
  const enrolledCourses = [
    { id: 1, title: 'Course 1', enrolled: true },
    { id: 2, title: 'Course 2', enrolled: true },
    // Add more enrolled courses here
  ];

  const availableCourses = [
    { id: 3, title: 'Course 3', enrolled: false },
    { id: 4, title: 'Course 4', enrolled: false },
    // Add more available courses here
  ];

  return (
    <div className="course-list-container">
      <div className="course-list">
        <h2>Enrolled Courses</h2>
        {enrolledCourses.map((course) => (
          <div className="course" key={course.id}>
            {course.title}
          </div>
        ))}
      </div>
      <div className="course-list">
        <h2>Available Courses</h2>
        {availableCourses.map((course) => (
          <div className="course" key={course.id}>
            {course.title}
          </div>
        ))}
      </div>
    </div>
  );
}

export default CourseList;
